messages.content:
@Andy | Eco 1. Eco 앱은 현재 미국에서만 사용할 수 있습니다 (확장 하려고 노력중입니다!). 이 앱을 사용하려면 KYC가 필요하므로 미국 거주자가 아닌 경우 사용할 수 없습니다.

2.하지만! 여기 Discord에서 포인트를 얻을 수 있습니다. 많은 방법이 있고 ... 더 많은 방법이 생길 것입니다 ... 그들은 "연구용으로 만 사용됩니다.".....하지만 당신이 그것을 원하는 것이 좋을 것 같아요.

3. Discord에서 아이디어를 찾아보세요. 예를들어 : # 🧪meme-lab ... 질문에 대해 답변 등 ... Discord가 깨끗하고 체계적으로 유지되도록 ... 그리고 앞으로도 더욱 더 그렇게 되도록
